import React from 'react'
import Lottie from 'lottie-react';
import Watch from '../assets/lottie/watch.json'

const LottiePractice = () => {
    return (
        <div>
            <h3 className='font-inter font-semibold text-4xl text-black text-center pb-9 animate__animated animate__flipInX animate__slow 1s'>LOTTIEPRActice </h3>
            <div>
                <Lottie
                    animationData={Watch}
                />
            </div>
        </div>

    )
}

export default LottiePractice
